import { Carousel } from 'react-responsive-carousel'
import './SeriesSlider.scss'

const productsImages = [
    {},
    {},
    {}
]

function SeriesSlider() {
    return (
        <Carousel
        showIndicators={false}
        showArrows={true}
        showStatus={false}
        centerMode={false}
        showThumbs={false}
        selectedItem={0}
        autoPlay={false}
        preventMovementUntilSwipeScrollTolerance={false}
        swipeable={true}
        className="carousel"
    >
        <div className="slider-item-custom">1</div>
        <div className="slider-item-custom">2</div>
        <div className="slider-item-custom">3</div>
    </Carousel>
    )
}

export default SeriesSlider
